
#include <bits/stdc++.h>
using namespace std;

int main(){
    int N;
    string C,aux;
    while(scanf("%d",&N)==1){
        cin.ignore();
        cin>>C;
        if(C[0]=='C') break;
        for(int i=0; i<N;i++){
            aux="";
            for(unsigned int j=0; j<C.length();j++){
                if(C[j]=='N') { aux+=C[j]; aux+="A"; }
                else if(C[j]=='A') { aux+=C[j]; aux+="N"; }
                else aux+=C[j];
            }
            C=aux;
        }
        cout<<C<<'\n';
    }
    return 0;
}

